            <h3>Leroy Deniz</h3>
            <p>Grado en Ingeniería Informática<br />
              Especialidad Ingeniería de Software<br /><br />
              (+34) 669 987 109<br />
              leroydeniz <code>[at]</code> icloud.com<br /><br />
              <code>https://leroydeniz.com</code>
            </p>
          </header>
        )
    }

}
